// @downloadURL https://update.greasyfork.org/scripts/485845/MeoLeo%20Glass.user.js
// @updateURL https://update.greasyfork.org/scripts/485845/MeoLeo%20Glass.meta.js
// ==/UserScript==

(function () {
    'use strict';

    const mainOpacity = 0.3; // Adjust the main opacity value from 0.0 to 1
    const blur = '50px'; // Adjust the blur value as per your preference
    const BackgroundImage = 'data:image/png;base64,'; // Background image url

    const repliesOpacity = mainOpacity + 0.1; // Opacity for replies div DO NOT EDIT

    const style = document.createElement('style');
    style.innerHTML = `
        html, body {
            height: 100%;
            margin: 0;
            padding: 0;
            background-repeat: no-repeat;
            background-size: cover;
            background-attachment: fixed;
            background-position: center;
            color: white !important; /* Set text color to white */
        }

        input.login-input.text, /* Login textboxes */
        input.login-input.button, /* Login buttons */

        textarea.message-input.text, /* Post Content box */
        button.message-send.button, /* Send Post button */
        button.message-tool.button.emoji-button, /* Emoji picker button */
        button.message-tool.button, /* File upload button */
        div.post, /* Posts */

        div.jump.visible, /* Jump to top button */

        button.navigation-button.button, /* Chats */

        div.section.stats, /* Meower Statistics */
        input.section-input, /* Go to user input box */

        div.section, /* Generic Sections */
        div.stg-section, /* New general settings */
        button.button.blockeduser, /* Account actions & Blocked Users */
        button.blockedword.button, /* Blocked words */

        button.language.button, /* Language Buttons */

        input.navigation-button.button:not(.theme-button), /* Most buttons except theme-button */
        button.section-send.button, /* A few more buttons */

        div.modal, /* Modals */
        button.modal-button, /* Modal buttons */
        button.modal-back-btn, /* Modal back buttons */
        button.modal-close, /* Close Modal button */
        textarea.mdl-txt, /* Modal textboxes */
        select.modal-select, /* Modal dropdowns */
        input.mdl-inp, /* Modal inputs */

        button.ubtn.button, /* Start page users */
        button.qbtn.button, /* Start page buttons */

        button.search-input.button, /* Chats search button */
        input.big-mdl-inp, /* Chats search box */
        div.searchitem, /* Search results */
        navigation-button.button.gcbtn, /* Groups */

        button.user-area.button, /* Profile button */

        div.plugin, /* Plugins */
        textarea.editor, /* Custom CSS & JS input box */
        input.cstpgbt, /* Custom Plugins run button */
        button.cstpgbt /* Custom CSS Apply Button */ {
            /* background-color: rgba(0, 0, 0, ${mainOpacity}); */
            backdrop-filter: blur(${blur}) saturate(1.5);
            -webkit-backdrop-filter: blur(50px) saturate(1.5);
            box-shadow: none;
            color: white !important; /* Set text color to white */
            background: rgba(100, 100, 100, 0.2);
            border-radius: 10px;
            box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
            border: 1px solid rgba(51, 51, 51, 0.3);
        }

        /* div.emojipicker, /* Emoji picker */  {
            background-color: rgba(0, 0, 0, 1);
            backdrop-filter: blur(${blur}) saturate(1.5);
            -webkit-backdrop-filter: blur(${blur}) saturate(1.5);
            box-shadow: none;
            color: white !important; /* Set text color to white */
            background: rgba(100, 100, 100, 0.2);
            border-radius: 10px;
            box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
            -webkit-backdrop-filter: blur(${blur});
            border: 1px solid rgba(51, 51, 51, 0.3);
        }

        div.emojisidebar, /* Emoji picker sidebar */
        button.emojibuttonside, /* Emoji picker sidebar buttons */
        div.emojicont, /* Not sure what this is but contains emojis */
        div.emojisearch, /* Emoji Searcher */
        input.emjinpt, /* Emoji Searcher */
        div.emojisec, /* MORE Emoji Stuff */
        button.emojibutton /* Emoji buttons */ {
            /* background-color: rgba(0, 0, 0, ${mainOpacity}); */
            backdrop-filter: blur(${blur});
            -webkit-backdrop-filter: blur(50px) saturate(1.5);
            box-shadow: none;
            color: white !important; /* Set text color to white */
            background: rgba(100, 100, 100, 0.2);
            border-radius: 10px;
            box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
            border: 1px solid rgba(51, 51, 51, 0.3);
        }

        textarea.message-input.text {
            color: #fff;
            /* background-color: rgba(0, 0, 0, ${mainOpacity}); */
            backdrop-filter: blur(${blur});
            -webkit-backdrop-filter: blur(50px) saturate(1.5);
            box-shadow: none;
            color: white !important; /* Set text color to white */
            background: rgba(100, 100, 100, 0.2);
            border-radius: 10px;
            box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
            border: 1px solid rgba(51, 51, 51, 0.3);
        }

        div.toolbarContainer {
            background-color: rgba(0, 0, 0, ${repliesOpacity});
        }

        textarea.message-input.text::placeholder,
        input.search-input::placeholder,
        input.section-input::placeholder,
        textarea.editor::placeholder {
            color: #ebebeb;
        }

        div.message-container, /* Message Area box */
        div.buttonContainer, /* Buttons on messages */
        div.toolbarContainer, /* Buttons on messages */
        toolbarContainer, /* Box around buttons on post actions */
        div.toolButton /* Buttons on messages */ {
            background-color: rgba(0, 0, 0, 0);
            color: white !important; /* Set text color to white */
        }

        span.edit-info {
            background-color: transparent;
        }


        div.modal.custom-bg,
        iframe.profile {
            backdrop-filter: inherit !important;
            background: inherit !important;
            border: inherit !important;
            box-shadow: inherit !important;
            color: inherit !important;
        }

        .dark-theme,
        div.modal-top, /* Also Modals */
        div.toolbarContainer {
            --hov-color: rgba(0, 0, 0, ${repliesOpacity});
            --hov-accent-color: rgba(0, 0, 0, ${repliesOpacity});
            --hov-modal-button-color: rgba(0, 0, 0, ${repliesOpacity});
            --hov-button-color: rgba(0, 0, 0, ${repliesOpacity});
        }
    `;
    document.head.appendChild(style);

    // Function to apply the background image
    function applyBackgroundImage() {
        const backgroundImage = localStorage.getItem('meoglass_bg') || BackgroundImage;
        document.documentElement.style.backgroundImage = `url('${backgroundImage}')`;
    }

    // Apply the background image on script start
    applyBackgroundImage();

    // Function to remove buttons with class "theme-button"
    function removeThemeButtons() {
        const themeButtons = document.querySelectorAll('.theme-button');
        themeButtons.forEach(button => button.remove());
    }

    // Attach click event listener to document
    document.addEventListener('click', removeThemeButtons);

    // Function to handle the textarea input
    function handleTextareaInput(event) {
        const textarea = event.target;
        if (textarea.classList.contains('message-input') && textarea.classList.contains('text')) {
            if (event.key === 'Enter') {
                if (textarea.value.startsWith('!meoglass bg reset')) {
                    localStorage.removeItem('meoglass_bg');
                    alert('Background reset to default! Click OK to refresh the page and fully apply changes.');
                    location.reload();
                } else if (textarea.value.startsWith('!meoglass bg')) {
                    const url = textarea.value.substring(12).trim();
                    localStorage.setItem('meoglass_bg', url);
                    alert('Background setting applied! Click OK to refresh the page and fully apply changes.');
                    location.reload();
                } else if (textarea.value === '!meoglass help') {
                    alert('Run !meoglass bg (url) to set the background image (can be url or base64)\n\nRun !meoglass bg reset to reset the background');
                }
            } else {
                if (textarea.value.startsWith('!meoglass')) {
                    textarea.id = 'cmd';
                } else {
                    textarea.id = 'msg';
                }
            }
        }
    }

    // Attach keydown event listener to textarea
    document.addEventListener('keydown', handleTextareaInput);
})();
